$SOURCE_PERF_SPEC_PARAMS:{ obj | $if(obj.comma)$ UNION ALL $endif$
case when EXT_SAMPLE_SUBSCRIBER_1.IMSI is null then ES_SAMPLE_SUBSCRIBER_1.IMSI else case when LOWER(EXT_SAMPLE_SUBSCRIBER_1.IMSI)=''null'' then NULL else EXT_SAMPLE_SUBSCRIBER_1.IMSI end end,case when EXT_SAMPLE_SUBSCRIBER_1.IMSI is null then ES_SAMPLE_SUBSCRIBER_1.MSISDN else case when LOWER(EXT_SAMPLE_SUBSCRIBER_1.MSISDN)=''null'' then NULL else EXT_SAMPLE_SUBSCRIBER_1.MSISDN end end,case when EXT_SAMPLE_SUBSCRIBER_1.IMSI is null then ES_SAMPLE_SUBSCRIBER_1.SUBSCRIPTION_START_DATE else unix_timestamp(SUBSCRIPTION_START_DATE_INP) end from ES_SAMPLE_SUBSCRIBER_1 full outer join (select ROW_TABLE.IMSI,ROW_TABLE.MSISDN,ROW_TABLE.SUBSCRIPTION_START_DATE_INP from (select EXT_SAMPLE_SUBSCRIBER_1.IMSI,EXT_SAMPLE_SUBSCRIBER_1.MSISDN,EXT_SAMPLE_SUBSCRIBER_1.SUBSCRIPTION_START_DATE_INP,row_number() over (partition by IMSI)KEYPARTITION from EXT_SAMPLE_SUBSCRIBER_1 )ROW_TABLE where ROW_TABLE.KEYPARTITION=1)EXT_SAMPLE_SUBSCRIBER_1 on EXT_SAMPLE_SUBSCRIBER_1.IMSI=ES_SAMPLE_SUBSCRIBER_1.IMSI', NULL);
